INSERT INTO `history` VALUES (1,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1908,'由8个国家(比利时、丹麦、芬兰、法国、德国、英国、匈牙利和瑞典)在伦敦(英国)倡议成立FINA'),(2,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1912,'在斯德哥尔摩(瑞典)奥运会上首次列入女子水下比赛'),(3,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1922,'约翰尼·韦斯米勒(美国)在百米自由泳中首次创下1分钟(58.6秒)以内的游泳纪录'),(4,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1926,'格特鲁德·埃德尔(美国)不仅作为第一位女性，还以比上个纪录快两小时的速度游过了英国海峡'),(5,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1948,'在伦敦奥运会上，水球项目聚集了五大洲队伍成为了国际普及项目'),(6,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1956,'在墨尔本(澳大利亚)奥运会上，蝶泳首次被列入成为奥林匹克项目'),(7,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1957,'只有公制标准测定的世界纪录才能作为有效记录得到国际认定'),(8,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1964,'大卫·弗雷泽(澳大利亚)在东京奥运会上达成前所未有的“帽子戏法(hat-trick)”，完成百米自由泳三冠王'),(9,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1968,'在墨西哥城奥利匹克运动会上首次引入电子记录制度'),(10,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1972,'马克斯·皮茨(美国)在慕尼黑(德国)奥运会上成为首次摘取7枚金牌(游泳项目)的运动选手，并且所有成绩都突破了世界纪录'),(11,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1973,'在贝尔格莱德(南斯拉夫)举办了首届FINA世界游泳锦标赛，比赛设有游泳、水球、跳水、水中芭蕾等项目(在1991年增加了海上游泳项目)'),(12,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1980,'弗拉基米尔·萨尔尼科夫(俄罗斯)在莫斯科奥运会1,500米自由泳中以14:58:27秒的成绩打破了15分钟的纪录'),(13,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1984,'在洛杉矶奥运会上增加了水中芭蕾项目'),(14,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1986,'FINA在洛桑(瑞士)开设事务局'),(15,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1988,'在FINA世界游泳锦标赛上取得五枚奖牌的格雷格·洛加尼斯(美国)，在奥运会上以优秀的跳水能力取得五枚奥运奖牌后宣布退役'),(16,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1991,'在25米的泳池内达成世界纪录'),(17,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1992,'巴塞罗那(西班牙)奥运会是伟大的游泳冠军马特·比昂迪(美国)的落幕之战。在本次大会上，马特·比昂迪出战十一项全部取得金牌，并在FINA世界游泳锦标赛上也取得11枚奖牌'),(18,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1993,'在帕尔马·马略卡(西班牙)举办了首届FINA世界游泳锦标赛(25米)'),(19,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,1996,'作为史上最强水球运动选手的马努尔·埃斯蒂亚特(西班牙)不仅出战了六次奥运会(1980-2000년)，更在亚特兰大奥运会摘取了金牌'),(20,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2000,'在悉尼(澳大利亚)奥运会上,女子水球与水中芭蕾被列入了奥运会正式项目'),(21,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2004,'亚历山大·波波夫(俄罗斯)在奥运会上共摘取9枚奖牌，在FINA世界游泳锦标赛上也取得了11枚奖牌，他在这样辉煌的战绩中退役'),(22,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2005,'IOC决定从2008年北京(中国)奥运会开始在奥运会中加入马拉松游泳(10公里)项目'),(23,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2008,'迈克尔·菲尔普斯(美国)击败马克斯·皮茨在北京(中国)奥运会成为奥运会史上第一位摘取8枚金牌的选手，并在4年后的伦敦奥运会上以18枚金牌、22枚奖牌的纪录成为了奥运会历史上获得奖牌数最多的选手，他在伦敦奥运会之后发表了退役声明'),(24,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2010,'FINA在埃斯特角(乌拉圭)举办第1届FINA世界水上运动大会(WorldAquaticsConvention)'),(25,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2011,'获得6枚奥运会奖牌和11枚世界锦标赛奖牌的郭晶晶(中国)宣布结束跳水运动选手生涯'),(26,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2012,'第二届世界水上运动大会在莫斯科(俄罗斯)单独进行后，从2014年开始与FINA世界游泳锦标赛(25米)一同举办'),(27,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2013,'在巴塞罗那(西班牙)举办的FINA世界游泳锦标赛中首次加入了高空跳水项目'),(28,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2014,'第12届FINA世界游泳锦标赛(25米)的水上庆典(AquaticFestival)首次在多哈(卡塔尔)举办。水上庆典是由FINA世界水上运动大会、FINA游泳教练金牌讲习班、FINA临时总会、为当时最优秀运动选手举办的“SoiréedesEtolies”晚会秀、SwimmingYouth节目等组成'),(29,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2015,'继7月24日至8月16日期间的喀山(俄罗斯)FINA世界游泳锦标赛之后，举办了FINA史上首届世界游泳大师锦标赛，进行了精英运动选手的混合泳、混合跳水、混合水中芭蕾等项目'),(30,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2017,'从7月14日到30日，在布达佩斯(匈牙利)举办了FINA世界游泳锦标赛'),(31,'2019-08-04 19:37:30','2019-08-04 19:37:30',NULL,2019,'从7月12日到28日，在光州(韩国)举办了FINA世界游泳锦标赛');
/*!40000 ALTER TABLE `history` ENABLE KEYS */;
UNLOCK TABLES;

