INSERT INTO `sports` VALUES (16,'2019-08-04 19:47:30','2019-08-04 19:47:30',NULL,13,1,'跳水','游泳项目以自由泳、仰泳、蛙泳、蝶泳等指定游法，50米到1,500米的方式进行，顺序为预赛、半决赛和决赛。在50米、100米和200米的比赛中，首先从预选赛中选出16名得分最高的选手，16名选手将分成两组进行半决赛，最终有8名选手进入决赛。在长距离和接力泳项目中，8名通过预赛的选手直接进行800米和1,500米的决赛。','[80,81,82,83,84,85,86,87,88,89,90]','․ 1米跳板 : 分为预赛和决赛，预赛成绩前12名选手将晋级决赛。 <br>\r\n․ 3米跳板与10米跳台 : 分为预赛、半决赛、决赛，预赛成绩前18名选手晋级半决赛，半决赛成绩前12名选手晋级决赛。 <br>\r\n․ 双人同步3米跳板与10米跳台 : 分为预赛和决赛，预赛成绩前12名选手将晋级决赛。 <br>\r\n․ 团体跳水(3米跳板与10米跳台) : 仅进行决赛。 <br>\r\n․ 男女混合(双人同步3米跳板与10米跳台) : 仅进行决赛。'),(17,'2019-08-04 19:47:37','2019-08-04 19:47:37',NULL,42,0,'游泳','游泳项目以自由泳，仰泳，蛙泳，蝶泳等指定游法，50米到1,500米的方式进行，顺序为预赛，半决赛和决赛。\r\n个人项目分为自由泳(50, 100, 200, 400, 800, 1,500米)·仰泳·蛙泳·蝶泳(50, 100, 200米)和个人混合泳(200, 400米)，团体项目分为接力泳(400, 800米)、混合泳接力(400米)、男女接力泳(400米)、男女混合泳接力(400米)。','[91,92,93,94,95,96,97,98,99,100,101,102,103,104,105,106]','所有比赛项目分成男女举行，参与比赛的选手必须游完规定的距离。选手只能在自己的泳道内游泳。所有比赛在开始时选手必须与泳池或泳道边缘发生身体接触。\r\n转弯时必须在池壁上进行，不允许从水池底部弹跳或走路。每个接力队伍由四名队员组成，男女混合接力队伍由两男两女组成。自由泳、蛙泳、蝶泳和个人混合泳从出发台出发，而仰泳和男女混合接力泳从泳池内出发。'),(19,'2019-08-04 19:47:44','2019-08-04 19:47:44',NULL,2,5,'水球','水球是一项水中球类的集体运动项目。每队七名球员(一名守门员和六名球员)，在一个长方形的游泳池中比赛。最多可以额外替换六名球员。比赛分4轮，每轮比赛8分钟。每轮会从球员触球的那一刻开始计时。','[107,108]','水球比赛根据FINA的规定进行，是游泳项目中唯一的球赛。每队由13名球员(7名上场球员、6名替补)组成，球员必须佩戴具备耳塞的水帽(白色/蓝色)以便识别和预防伤病。比赛分为四节，每节8分钟，每节结束后依次休息2分钟、3分钟、2分钟，第三节开始之前更换休息区。'),(20,'2019-08-04 19:47:46','2019-08-04 19:47:46',NULL,7,4,'公开水域游泳','公开水域游泳是在湖水、江河、大海上进行的户外游泳比赛。由于公开水域游泳比赛是在户外自然环境下进行比赛，所以需要应对比赛中可能发生的天气变化，特别是在比赛服、阳光、风、水温、气温、雨等多方面要进行充分考虑并安排保护措施。','[109,110,111,112,113,114,115]','尽管不限定游泳方法，但通常运动选手都会选择自由游。比赛的方式是男子女子比赛各安排一场直接决出排名。运动选手从跳台出发，在1.666公里(或2.50公里)的循环路线中游泳，需要在指定回程浮标和泳道边线内完成比赛。在比赛期间允许运动选手进食，结束比赛需进入终点线，并触摸终点线上安装的垂直墙。'),(21,'2019-08-04 19:47:48','2019-08-04 19:47:48',NULL,10,3,'花样游泳','花样游泳是融入游泳、舞蹈和音乐的一项优美的水上运动，所有又被称之水上芭蕾或艺术游泳。根据选手参赛人数可分为单人、双人、集体项目、自由组合项目，比赛类型根据音乐和舞蹈的情况又分为不受限制的自由自选和必须包含规定动作的技术自选。','[116,117,118,119,120,121,122,123,124,125]','具体项目分为单人、双人、8人进行的集体、8~10人进行的自由组合和亮点动作表演。除了自由组合与亮点动作表演外，其他项目均分为技术自选和自由自选。<br>\r\n- 技术自选：每个单人、双人、男女混合双人、集体项目的参赛者要在表演中完成FINA规定的动作。比赛时间含10秒的入水前动作在内，单人项目为2分钟，双人项目为2分20秒，集体项目是2分50秒，允许±15秒。<br>\r\n- 自由自选：每个单人、双人、男女混合双人、集体项目的参赛者按照自己指定的音乐进行自由表演。对音乐、舞蹈没有任何限制。比赛时间含10秒的入水前动作在内，单人项目为2分30秒，双人项目为3分钟，集体项目是4分钟，自由组合项目是4分钟，亮点动作表演是2分30秒，允许±15秒。'),(22,'2019-08-04 19:47:50','2019-08-04 19:47:50',NULL,2,2,'高空跳水','高空跳水是从20米以上跳台跳入水中的项目。其中，男子跳台的高度为27米，女子跳台的高度是20米。','[126,127]','․ 男子比赛分成两个赛程，第一天为赛程1，第三天进行赛程2。女子比赛也分为两个赛程，第一天进行赛程1，第二天进行赛程2。<br>\r\n․ 男子比赛共四场比赛，其中一场难度系数为2.8，另一场难度系数最高为3.6，这两个项目需要使用不同的技巧。另外的两场比赛则是不限定难度的不同跳水技巧。<br>\r\n․  女子比赛共四场比赛，需要完成难度系数为2.6的两场不同跳水技巧及两场不限定难度的不同跳水技巧。<br>\r\n․ 比赛会分成各个部分进行，进行时会按照前一轮比赛成绩的相反顺序进行，全程比赛成绩叠加后的综合成绩最高分者为冠军，通过最终综合成绩决定运动选手的排名。');
