INSERT INTO `symbol` VALUES (1,'2019-08-04 19:36:45','2019-08-04 19:36:45',NULL,'将无等山(温柔的怀抱)和荣山江(生命的呼吸)形象化的“和平波浪”中，蕴含着“全力挑战未来梦想”的期待。','https://www.fina-gwangju2019.com/home/chn/images/sub/symbol01.png','标志','光州承载着守护大韩民国的民主和人权并提升人类和平价值的愿望。','https://www.fina-gwangju2019.com/home/chn/images/sub/symbol02.png','标语','https://www.fina-gwangju2019.com/home/chn/images/sub/symbol03_1.png','将和平栖息在无等山与荣山江的天然纪念物(第330号)水獭拟人化设计为了一对雌雄吉祥物。','吉祥物','[1,2,3,4,5]');
